import axios from 'axios';
import {useEffect, useRef} from 'react';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => ({
    container: {
        display: 'flex',
        flexWrap: 'wrap',
    },
    textField: {
        width: 200,
        marginTop: "1em",
        color: "white"
    }
}));

export default function TutorDashboard(props) {
    const classes = useStyles();
    const addScheduleRef = useRef();
    const {setDisplayNavbar, setUser} = props;
    setDisplayNavbar(true);
    useEffect(() => {
        const ac = new AbortController();
        axios.get('/auth/isLoggedIn')
            .then(res => res.data)
            .catch(err => console.log(err))
            .then(res => {
                if (res.isLoggedIn) {
                    const user = res.user;
                    setUser(user);
                } else {
                    window.open('/', '_self');
                }
            })
        return () => {
            ac.abort();
        }
    }, [setUser]);

    function handleSubmit() {

    }

    return <div className="wrapper">
        <div className="sidebar">
            <ul>
                <li><a href="#tutoringSchedule">Tutoring schedule</a></li>
                <li><a href="#addNewSchedule">Add new schedule</a></li>
            </ul>
        </div>
        <div className="content" style={{overflowX: "hidden"}}>
            <div className="box">
                <a name="tutoringSchedule"></a>
                <div className="box_top">
                    <h2>Tutoring schedule</h2>
                </div>
                <div className="box_bottom">
                    <div className="calendar_container">
                        <div className="calendar_header">
                            <ul className="weekdays">
                                <li>SUN</li>
                                <li>MON</li>
                                <li>TUE</li>
                                <li>WED</li>
                                <li>THU</li>
                                <li>FRI</li>
                                <li>SAT</li>
                            </ul>

                            <ul className="daynumbers">
                                <li>1</li>
                                <li>2</li>
                                <li>3</li>
                                <li>4</li>
                                <li>5</li>
                                <li>6</li>
                                <li>7</li>
                            </ul>
                        </div>
                        <div className="timeslots_container">
                            <ul className="timeslots">
                                <li>GMT+7</li>
                                <li>01:00</li>
                                <li>02:00</li>
                                <li>03:00</li>
                                <li>04:00</li>
                                <li>05:00</li>
                                <li>06:00</li>
                                <li>07:00</li>
                                <li>08:00</li>
                                <li>09:00</li>
                                <li>10:00</li>
                                <li>11:00</li>
                                <li>12:00</li>
                                <li>13:00</li>
                                <li>14:00</li>
                                <li>15:00</li>
                                <li>16:00</li>
                                <li>17:00</li>
                                <li>18:00</li>
                                <li>19:00</li>
                                <li>20:00</li>
                                <li>21:00</li>
                                <li>22:00</li>
                                <li>23:00</li>
                            </ul>
                        </div>

                        <div className="event_container">
                            <div className="slot slot-1">
                                <div className="event_status">Event 1</div>
                            </div>
                            <div className="slot slot-2">
                                <div className="event_status">Event 2</div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
            <div className="box">
                <a name="addNewSchedule"></a>
                <div className="box_top">
                    <h2>Add new schedule</h2>
                </div>
                <div className="box_bottom">
                    <form ref={addScheduleRef}>
                        <TextField 
                            id="outlined-basic" 
                            label="Enter title" 
                            variant="outlined"/><br />
                        <TextField
                            placeholder="Description"
                            multiline
                            rows={4}
                            rowsMax={4}
                            variant="outlined"
                            style={{marginTop: "1em", width: "50%"}}
                        />
                        <div className={classes.container} noValidate>
                            <TextField
                                name="startTime"
                                id="startTime"
                                variant="outlined"
                                label="Start time"
                                type="datetime-local"
                                defaultValue={new Date().toString()}
                                className={classes.textField}
                                InputLabelProps={{
                                shrink: true,
                                className: classes.input
                                }}
                                InputProps={{ className: classes.input }}
                            />
                            <TextField
                                style={{marginLeft: '1em'}}
                                name="endTime"
                                id="endTime"
                                variant="outlined"
                                label="End time"
                                type="datetime-local"
                                value={new Date().toString()}
                                onChange={(event) => {
                                    console.log(event);
                                }}
                                className={classes.textField}
                                InputLabelProps={{
                                shrink: true,
                                className: classes.input
                                }}
                                InputProps={{ className: classes.input }}
                            />
                        </div><br />
                    </form>
                    <Button style={{
                        height: "56px",
                    }} onClick={() => {

                    }} variant="outlined" color="secondary">
                        Add
                    </Button>
                </div>
            </div>
            
        </div>
    </div>
}
